window.bookSummaryJSON = "<p><b>Arabella Lane is found dead in the Thames on a frosty winter’s morning after the office Christmas party. No one is sure whether she jumped or was pushed. The one person who may know the truth is the office temp, Eleanor. </b></p> <p>Having traveled to London to escape the repercussions of her traumatic childhood in Australia, tragedy seems to follow Eleanor wherever she goes. To her horror, she has no memory of the crucial hours leading up to Arabella’s death - memory that will either incriminate or absolve her.&nbsp;</p> <p>Caught in a crossfire of accusations, Eleanor fears she can’t even trust herself, let alone the people around her. And soon, she’ll find herself in a race against time to uncover what happened that night - and discover just how deadly some secrets can be.</p>"; 
